import Navbar from './components/Navbar';

function Homegate() {
  return (
     <>
    <Navbar />
    <div>
      <h1>Welcome to Homegate</h1>
      <p>Homegate is a platform for buying and selling homes.</p>
    </div>
    </>
  );
}

export default Homegate;
